	('019c2804-6170-7397-ae3e-20015e8e8e2f', 'LARGE NUMBERS', 'Explores how large numbers are formed by adding 1 to the greatest numbers of a given digit count and provides key number conversions.', '019c2804-616f-7ba5-b6e6-33d5bccba09b', '1', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6178-70b6-b8b4-fb6a02945f73', 'INDIAN SYSTEM OF NUMERATION', 'Defines numeration and notation, explaining how numbers are expressed in words and digits using periods like ones, thousands, lakhs, crores, and arabs.', '019c2804-616f-7ba5-b6e6-33d5bccba09b', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6180-7f9d-b62a-9bd99d4f8015', 'Place Value and Face Value', 'Explains the difference between a digit''s intrinsic value and its value based on its position in a number.', '019c2804-616f-7ba5-b6e6-33d5bccba09b', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6184-7bf6-9f79-612a387c0324', 'Expanded Notation', 'Details how to write a number as the sum of the place values of all its constituent digits.', '019c2804-616f-7ba5-b6e6-33d5bccba09b', '4', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6187-7c92-aae9-a360d3684679', 'INTERNATIONAL SYSTEM OF NUMERATION', 'Describes expressing numbers using periods like ones, thousands, millions, and billions, with different comma placements.', '019c2804-616f-7ba5-b6e6-33d5bccba09b', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-618b-7780-80b5-cde8086e990c', 'COMPARISON OF NUMBERS', 'Provides a systematic procedure to determine which of two given numbers is greater or smaller.', '019c2804-616f-7ba5-b6e6-33d5bccba09b', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-618f-7fd0-9220-95cbd5bd7cf0', 'Successor and Predecessor', 'Defines the terms for the numbers immediately following and preceding a given number.', '019c2804-616f-7ba5-b6e6-33d5bccba09b', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6193-7a8e-a706-0ef32204f417', 'LARGE NUMBERS IN PRACTICE', 'Applies the understanding of large numbers to real-world measurements using the metric system for length, mass, and capacity.', '019c2804-616f-7ba5-b6e6-33d5bccba09b', '8', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-619a-7eb8-9828-b9729dec3573', 'Units of Length', 'Lists specific conversion factors within the metric system for various units of length.', '019c2804-616f-7ba5-b6e6-33d5bccba09b', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
